{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/swmando/cyclistic-bike-share-case-study?scriptVersionId=102690743\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"attachments":{"295449da-f93f-4d76-a009-8c3f41a881d0.png":{"image/png":""},"9e4fd161-c2ec-47dc-9f60-87b87e971680.png":{"image/png":""}},"cell_type":"markdown","id":"17ee36bf","metadata":{"_cell_guid":"0c442c11-2a2e-48f7-badb-1dc8d8492394","_uuid":"a94d0da1-eccd-4374-b6c1-9c76e5914ad8","jupyter":{"outputs_hidden":false},"papermill":{"duration":0.003629,"end_time":"2022-08-06T21:53:54.922818","exception":false,"start_time":"2022-08-06T21:53:54.919189","status":"completed"},"tags":[]},"source":["\n","# Cyclistic Bike-Share Case Study\n","\n","\n","\n","## Introduction\n","Cyclistic is a fictitous bike-share company in Chicago and has hired our marketing team with the goal of maximizing the number of annual memberships. In this case study, I have analyzed the past 12 months of available data on bike usage and include a marketing strategy to effectively strengthen Cyclistic's brand and encourage noticable growth in memberships.\n","\n","### Phase 1: Ask\n","\n","Key Objectives:\n","\n","   1. Identify the business task\n","   \n","      The main focus is delivering a marketing strategy in order to maximize the number of annual memberships. To do this I have aimed to answer three questions:\n","      \n","      How do annual members and casual riders use Cyclistic bikes differently?\n","      Why would casual riders buy Cyclistic annual memberships?\n","      How can Cyclistic use digital media to influence casual riders to become members?\n","\n","   2. Consider key stakeholders\n","   \n","      The key stakeholder is the Cyclistic company including the director of marketing Lily Moreno, the Cyclistic marketing analytics team, and the Cyclistic executive team.\n","      \n","### Phase 2: Prepare\n","\n","Key Objectives:\n","\n","   1. Acquire available data and store it appropriately\n","   \n","      Since Cyclistic has each of their bicycles geotracked, I have acquired and downloaded the previous 12 months of Cyclistic's historical trip data in order to analyze and identify trends. This data ranges from July 2021 to June 2022.\n","      \n","      As there are nearly 6 million data points, I have chosen to use Rstudio to analyze this large amount of data.\n","      \n","      The following code throughout the case study is written in R and utilized for data analysis and visualization.\n","\n","   \n","\n","#### Task: download previous 12 months of data\n","\n","Here I downloaded the individual data in .csv format and uploaded it to RStudio\n","\n","\n","\n","read_csv(202107.divvy.tripdata)\n","\n","read_csv(202206.divvy.tripdata)\n","\n","\n","\n","### Phase 3: Process\n","\n","Key Objectives:\n","\n","   1. Check data for errors and transform the data to work with effectively\n","   \n","\n","#### Task: installing/loading packages\n","\n","To set up RStudio, I have installed/loaded the following packages.\n","\n","\n","library(dplyr)\n","library(tidyr)\n","library(tidyverse)\n","library(lubridate)\n","library(ggplot2)\n","\n","\n","#### Task: confirm consistency of data frames \n","\n","I then compared the structure and column names of all downloaded data frames to confirm consistency.\n","\n","\n","colnames(202107.divvy.tripdata)\n","colnames(202206.divvy.tripdata)\n","\n","\n","str((202107.divvy.tripdata)\n","colnames(202206.divvy.tripdata)\n","\n","\n","##### Task: integrating all data into single data frame\n","\n","Once all the data has been confirmed, I integrated the separate data frames into a master data frame titled `alldata`.\n","\n","alldata <- rbind(`202107.divvy.tripdata`, `202108.divvy.tripdata`, `202109.divvy.tripdata`, `202110.divvy.tripdata`, `202111.divvy.tripdata`, `202112.divvy.tripdata`, `202201.divvy.tripdata`, `202202.divvy.tripdata`, `202203.divvy.tripdata`, `202204.divvy.tripdata`, `202205.divvy.tripdata`, `202206.divvy.tripdata`)\n","\n","\n","##### Task: clean data by removing the rows with NA\n","\n","Here I have noticed that there were some rows that were missing values. To solve this, I have omitted the rows with missing values and stored the new data into a new master data frame. I also made sure this removal of rows didn't affect the overall integrity of the analysis by removing a majority of the data. The removed rows were less than 1% of the total data.\n","\n","\n","alldata2 <- na.omit(alldata)\n","view(alldata2)\n","\n","\n","### Phase 4: Analyze\n","\n","Key Objectives:\n","\n","   1. Utilize data and perfrom calculations to identify trends and relationships\n","   \n","   After reviewing the data, the best way to compare how annual members and casual riders use the bicycles is looking at total members vs casual members, when are they using the bikes, and a close analysis in how long their rides last.\n","   \n","   \n","#### Task: turning ride length data into date/time format\n","\n","I start by looking at when each bike ride started and ended at. However, this data is in the character format so to be able to perform calculations on this data I converted these columns into date/time format.\n","\n","\n","alldata2$ended_at <- as_datetime(alldata2$ended_at)\n","alldata2$started_at <- as_datetime(alldata2$started_at)\n","\n","\n","\n","#### Task: adding column for ride length \n","\n","Then, I subtract the `started_at column` from `ended_at column` to retrieve the total ride length.\n","\n","\n","alldata2$ride_length <- (alldata2$ended_at - alldata2$started_at)\n","\n","\n","\n","#### Task: group by Member/Non Member status\n","\n","To make the data more managable, I split the main data frame into casual and members data. This is also where I've assessed there are 3,341,291 total members and 2,553,720 casual riders.\n","\n","\n","\n","casual_data <- alldata2 %>% group_by(member_casual) %>% filter(member_casual == 'casual')\n","member_data <- alldata2 %>% group_by(member_casual) %>% filter(member_casual == 'member')\n","\n","\n","\n","#### Task: calculated total ride length & mean ride length\n","\n","I added up the total ride lengths for members and casual riders as well as calculated the mean ride length.\n","\n","\n","\n","total_casual_ride_length <- alldata2 %>% group_by(member_casual) %>% filter(member_casual == 'casual') %>% summarise (total_casual_ride_length1 = sum(ride_length))\n","total_member_ride_length <- alldata2 %>% group_by(member_casual) %>% filter(member_casual == 'member') %>% summarise (total_member_ride_length1 = sum(ride_length))  \n","\n","mean_casual_ride_length <- mean(casual_data$ride_length) \n","seconds_to_period(mean_casual_ride_length)\n","\n","mean_member_ride_length <- mean(member_data$ride_length)\n","seconds_to_period(mean_member_ride_length)\n","\n","seconds_to_period(total_casual_ride_length)\n","seconds_to_period(total_member_ride_length)\n","\n","\n","Results:\n","\n","1.Casual Riders\n","\n","Total Ride Length: 46260 days, 13 hours, 16 minutes, 29 seconds\n","\n","Mean Length: 26 minutes 5 sec\n","\n","\n","\n","2.Members\n","\n","Total Ride Length: 29531 days, 15 hours, 7 minutes, 33 seconds\n","\n","Mean Length: 12 minutes 6 sec\n","\n","\n","#### Task: convert the start date into days of the week\n","\n","In order to find the days of the week that the bikes were being used, I converted `started_at` into a format that displays as a day of the week.\n","\n","\n","popular_day_casual <- alldata2 %>% group_by(member_casual) %>% filter(member_casual == 'casual') %>% summarise(day_of_the_week = weekdays(popular_day_casual$started_at))\n","\n","popular_day_member <- alldata2 %>% group_by(member_casual) %>% filter(member_casual == 'member')  %>% summarise(day_of_the_week = weekdays(popular_day_member$started_at))\n","\n","\n","\n","#### Task: count which day appears the most\n","Then, I calculated which day appeared the most in the member and casual rider respective data frames.\n","\n","\n","names(which.max(table(casual_day)))\n","names(which.max(table(popular_day)))\n","\n","\n","\n","#### Task: bar chart displaying Member vs Casual User data for most popular days\n","To confirm this data was correct, I wanted to visualize this data and did so using a bar chart.\n","\n","\n","ggplot(arrange(popular_day_casual,day_of_the_week), aes(x=day_of_the_week)) + geom_bar(aes(fill=day_of_the_week)) + labs(x=\"day\", title=\"Popular Days for Casual Users\")\n","\n","ggplot(arrange(popular_day_member,day_of_the_week), aes(x=day_of_the_week)) + geom_bar(aes(fill=day_of_the_week)) + labs(x=\"day\", title=\"Popular Days for Members\")\n","\n","![Casual.png](attachment:9e4fd161-c2ec-47dc-9f60-87b87e971680.png)\n","\n","![Members.png](attachment:295449da-f93f-4d76-a009-8c3f41a881d0.png)\n","\n","\n","    \n","### Phase 5 & 6: Share & Act (Conclusion and Recommendation)\n","\n","Now that I have analyzed the avaiable data, we have a better understanding to answer the three questions we set out to answer:\n","\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","      \n","      The results show that casual riders have a spike on the weekends. This may due to casual riders using the bicycles for leisure activities or out of town tourists visiting the area using the bicycles to travel around the city. However, members usage are consistent throughout the week which may be due to repeated work/school commutes.\n","      \n","      Casual riders also ride for more than double the length of members, so they may be taking their time enjoying the sights of the city or can also be due to casual riders being unfamiliar with the layout of the city and taking detours to get to their destination.\n","      \n","2. Why would casual riders buy Cyclistic annual memberships?\n","      \n","      A heavy incentive for casual riders to buy annual memberships can be a significant lower cost per use than the price they are paying now. Another reason could be a family discount if they want to ride their bikes with their family/friends.\n","      \n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","      \n","      Cyclistic can create a summer program where casual riders can sign up for a three-month summmer membership at a reduced cost. If they would like to add additional months, there can be a additional lower per/month cost up to three months.\n","      \n","      Additionally, once these summer membership users have ended their membership, Cyclistic can now send promotions to returning riders on sigining up for a full membership at a discounted price. Since the returning riders already had a foot in the door and know the product, it may be more likely they sign up for a full year if provided with a discount.\n","      \n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":3.868693,"end_time":"2022-08-06T21:53:55.047255","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-08-06T21:53:51.178562","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}